  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This is the official dataset associated
  with the Medicare.gov Physician Compare Website provided by the Centers for Medicare
  and Medicaid Services (CMS). These data give you useful information about the physicians
  and other healthcare professionals currently enrolled in Medicare. Currently, Physician
  Compare includes general information, such as demographic information and Medicare
  quality program participation. Quality of care measure data will be added to the
  site and to this database in 2014.</p>n<p>Because of data use agreements with data
  vendors, not all data on Physician Compare can be shared in this downloadable file.
  For more information about what is included in this database and how it differs
  from the information on the Physician Compare Website, refer to the data dictionary.</p>n\",\n\t\"license_title\":
